import React from 'react'
import {
  Grid, Header, Divider, Menu
} from 'semantic-ui-react';
import Link from 'next/link';
import Router from 'next/router';
import Axios from 'axios';

class HomeComp extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      name: '',
      phone: '',
      emailError: [],
      nameError: [],
      phoneError: [],
      errors: [],
    };
  }


  render() {
    return (
      <Menu secondary>
          <Link href="/login" passHref>
                      <a>
                        <Menu.Item>
                          <p>Login</p>
                        </Menu.Item>
                      </a>
                    </Link>
                    <Link href="/login" passHref>
                      <a>
                        <Menu.Item>
                          <p>About Us</p>
                        </Menu.Item>
                      </a>
                    </Link>
      </Menu>
    );
  }
}




export default HomeComp;
